char *_get_sysctl_prop(const char *key) {
  size_t size = 512;
  static char prop[512+1] = { 0 };
  if (sysctlbyname(key, prop, &size, NULL, 0) == 0) {
    prop[MIN(size, 512)] = 0;
    return prop;
  }
  return NULL;
}

const char *get_os_name(int major, int minor) {
  if (major == 14)
    return "Sonoma";
  if (major == 13)
    return "Ventura";
  if (major == 12)
    return "Monterey";
  if (major == 11)
    return "Big Sur";
  if (major == 10) {
    switch (minor) {
      case 4:
        return "Tiger";
      case 5:
        return "Leopard";
      case 6:
        return "Snow Leopard";
      case 7:
        return "Lion";
      case 8:
        return "Mountain Lion";
      case 9:
        return "Mavericks";
      case 10:
        return "Yosemite";
      case 11:
        return "El Capitan";
      case 12:
        return "Sierra";
      case 13:
        return "High Sierra";
      case 14:
        return "Mojave";
      case 15:
        return "Catalina";
      case 16:
        return "Big Sur";
    }
  }
  return NULL;
}

